import React from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import BoardList from '../BoardList';
import BoardHead from '../BoardHead';

class Board extends React.Component {
    state = {
        Boards: []
    }

    getBoardList = async () => {
        const {
            data: { data }
        } = await axios.get("http://localhost:8080/boardlist");
        console.log(data);
        this.setState({ Boards: data });
    }

    componentDidMount() {
        this.getBoardList();
    }
    render() {
        const { Boards } = this.state;
        return (
            <>
                <div className="container-fluid">
                    <Link to="/write" className="btn btn-success">글쓰기</Link>
                </div>
                <div>
                    <table className="table table-hover">
                        <BoardHead />
                        {Boards.map(function (Board) {
                            return <BoardList title={Board.title} name={Board.name} writedate={Board.writedate} readcount={Board.readcount} content={Board.content} pass={Board.pass} />
                        })}

                    </table>
                </div>
            </>
        );

    }
}

export default Board;
